\begin{document}
For $s=\sigma+it$, the Riemann zeta function is defined as
$\zeta(s)=\sum_{n=1}^{\infty} n^{-s}$. We show that this series
is absolutely convergent for $\sigma>1$.

Let $s=\sigma+it$ where $\sigma$ and $t$ are real and we assume
$\sigma>1$. Then
\[
|n^{-s}|=|e^{-s\log n}|=|e^{-\sigma \log n -it\log n}|=e^{-\sigma \log n}=n^{-\sigma}.
\]
Since $\sigma>1$, by the integral test, it follows that
$\sum_{n=1}^{\infty} |n^{-s}|=\sum_{n=1}^{\infty} n^{-\sigma}$
converges.
