    constructor(address _tokenAddress, uint256 _tokensPerEth, uint256 _minBuyEth, uint256 _maxBuyEth) {
        token = IERC20(_tokenAddress);
        tokensPerEth = _tokensPerEth;
        minBuyEth = _minBuyEth;
        maxBuyEth = _maxBuyEth;
        saleActive = true;
    }

    function buyTokens() external payable {
        require(saleActive, "Sale is not active");
        require(msg.value >= minBuyEth, "Amount below minimum");
        require(msg.value <= maxBuyEth, "Amount exceeds maximum");

        uint256 tokenAmount = msg.value * tokensPerEth;
        require(token.balanceOf(address(this)) >= tokenAmount, "Insufficient tokens in contract");

        token.transfer(msg.sender, tokenAmount);
        emit TokensPurchased(msg.sender, msg.value, tokenAmount);
    }

    function withdrawEth() external onlyOwner {
        payable(owner()).transfer(address(this).balance);
    }

    function withdrawTokens() external onlyOwner {
        uint256 balance = token.balanceOf(address(this));
        token.transfer(owner(), balance);
    }

    function setTokensPerEth(uint256 _tokensPerEth) external onlyOwner {
        tokensPerEth = _tokensPerEth;
    }

    function setMinBuyEth(uint256 _minBuyEth) external onlyOwner {
        minBuyEth = _minBuyEth;
    }

    function setMaxBuyEth(uint256 _maxBuyEth) external onlyOwner {
        maxBuyEth = _maxBuyEth;
    }

    function toggleSaleActive() external onlyOwner {
        saleActive = !saleActive;
    }
}
