To solve this problem, we need to find the maximum sum of any contiguous subarray within a given array of integers. The solution should efficiently compute this sum even for arrays containing negative numbers.

### Approach
The optimal approach to solve this problem is Kadane's algorithm, which efficiently computes the maximum subarray sum in linear time (O(n)) with constant space (O(1)). The algorithm works by iterating through the array while maintaining two variables:
1. **maxEndingHere**: Tracks the maximum sum of the subarray ending at the current position.
2. **maxSoFar**: Tracks the overall maximum subarray sum encountered so far.

For each element in the array:
- **maxEndingHere** is updated to be the maximum of the current element itself or the sum of **maxEndingHere** and the current element. This decision effectively starts a new subarray at the current element if the previous sum was negative.
- **maxSoFar** is updated to be the maximum of **maxSoFar** and **maxEndingHere**, ensuring it always holds the highest sum encountered during the traversal.

This approach efficiently handles arrays with all negative numbers by ensuring that the maximum subarray sum is at least the largest single element in the array.

### Solution Code
```java
import java.util.Scanner;

public class Main {
    public static int maxSubarraySum(int[] arr) {
        int maxEndingHere = arr[0];
        int maxSoFar = arr[0];

        for (int i = 1; i < arr.length; i++) {
            maxEndingHere = Math.max(arr[i], maxEndingHere + arr[i]);
            maxSoFar = Math.max(maxSoFar, maxEndingHere);
        }

        return maxSoFar;
    }

    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);
        int n = scanner.nextInt();
        int[] arr = new int[n];
        for (int i = 0; i < n; i++) {
            arr[i] = scanner.nextInt();
        }
        System.out.println(maxSubarraySum(arr));
    }
}
```

